const maxVowels = require("./index");

describe("maxVowels", () => {
  test("input s=abciiidef, k=3 should return 3", () => {
    const input = "abciiidef";
    const k = 3;
    const expectResult = 3;

    const result = maxVowels(input, k);
    expect(result).toEqual(expectResult);
  });

  test("input s=aeiou, k=2 should return 2", () => {
    const input = "aeiou";
    const k = 2;
    const expectResult = 2;

    const result = maxVowels(input, k);
    expect(result).toEqual(expectResult);
  });

  test("input s=leetcode, k=3 should return 2", () => {
    const input = "leetcode";
    const k = 3;
    const expectResult = 2;

    const result = maxVowels(input, k);
    expect(result).toEqual(expectResult);
  });

  test("input s=large, k=large should return 2", () => {
    const input =
      "";
    const k = 3945;
    const expectResult = 823;

    const result = maxVowels(input, k);
    expect(result).toEqual(expectResult);
  });
});
